public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  CacheRequest<K, V> other = (CacheRequest<K, V>) obj;
  if (key == null) {
    if (other.key != null) {
      return false;
    }
  } else if (!key.equals(other.key)) {
    return false;
  }

  return true;
}
